import React from "react";
import styles from "./orderPro.module.css"

function OrderPro() {
  return (
    <div className={styles.orderWrap}>
      <div>장바구니</div>
      <div>&gt;</div>
      <div>주문서 작성</div>
      <div>&gt;</div>
      <div>주문 완료</div>
    </div>
  );
}

export default OrderPro;
